import {makeStyles} from '@material-ui/core/styles';

const useStyles = makeStyles(
  (theme) => ({
    root: {
      
    },
    testHeading: {
      fontWeight: '1000',
      fontSize: '36px'
    },
    imgContainer: {
      display: "flex"
    },
    loungeImg: {
      margin: 'auto'
    },
    pmpBtnContainer: {
      display: "flex",
      position: "relative",
      borderStyle: "solid",
      borderWidth: "4px",
      borderColor: "#ED45A0",
      background: "green"
    },
    gridContainer: {
      width: "auto",
    },
    gridItem: {
      position: "relative",
      width: "100%",
      flexBasis: "auto",
      height: "100px",
      width: "100px",
      backgroundColor: "blue"
    },
    boxItem: {
      height: "100px",
      width: "100px",
      backgroundColor: "blue"
    },
  }),
  {index: 1},
);

export default useStyles;
